void Counter::drawDigit(int v, int x, int y)
{
	switch (v) {
		case 1: b_draw(x,y); break;
		case 2: c_draw(x,y); break;
		case 3: d_draw(x,y); break;
		case 4: e_draw(x,y); break;
		case 5: f_draw(x,y); break;
		case 6: g_draw(x,y); break;
		case 7: h_draw(x,y); break;
		case 8: i_draw(x,y); break;
		case 9: j_draw(x,y); break;
		default: a_draw(x,y); break;
	}
}
