void Counter::drawDigitSmall(int v, int x, int y)
{
	switch (v) {
		case 1: SB_draw(x,y); break;
		case 2: SC_draw(x,y); break;
		case 3: SD_draw(x,y); break;
		case 4: SE_draw(x,y); break;
		case 5: SF_draw(x,y); break;
		case 6: SG_draw(x,y); break;
		case 7: SH_draw(x,y); break;
		case 8: SI_draw(x,y); break;
		case 9: SJ_draw(x,y); break;
		default: SA_draw(x,y); break;
	}
}
