void Counter::draw()
{
	int a,b,c,x,y,v,first, col;
	
	if (m_needUpdate == 0) return;
	m_needUpdate = 0;
	m_curval     = m_val;
	x = m_x;
	y = m_y;
	v = m_val;
	m_curval = v;
	m_lastUpdate = millis();
	col = 0x9DEF;
	a = v/100;v =v%100;
	b = v/10;v=v%10;
	c = v;
	if (m_size == 0) {
		if ((a==0) && (b==0)) {
			TFT_fillRect(x, y, 32, a_IMAGE_H, col); x +=32;
			drawDigit(c, x, y); x += a_IMAGE_W;
			TFT_fillRect(x, y, (64 - a_IMAGE_W), a_IMAGE_H, col);
		} else if (a==0) {
			TFT_fillRect(x, y, 16, a_IMAGE_H, col); x +=16;
			drawDigit(b, x, y);
			TFT_fillRect((x + a_IMAGE_W), y, (32 - a_IMAGE_W), a_IMAGE_H, col); x += 32;
			drawDigit(c, x, y); x += a_IMAGE_W;
			TFT_fillRect(x, y, (64 - a_IMAGE_W), a_IMAGE_H, col);
		} else {
			drawDigit(a, x, y);
			TFT_fillRect((x + a_IMAGE_W), y, (32 - a_IMAGE_W), a_IMAGE_H, col); x += 32;
			drawDigit(b, x, y);
			TFT_fillRect((x + a_IMAGE_W), y, (32 - a_IMAGE_W), a_IMAGE_H, col); x += 32;
			drawDigit(c, x, y);
			TFT_fillRect((x + a_IMAGE_W), y, (32 - a_IMAGE_W), a_IMAGE_H, col);
		}
	} else if (m_size == 1) {
		if ((a==0) && (b==0)) {
			drawDigitSmall(c, x, y); x +=8;
			TFT_fillRect(x, y, 16, SA_IMAGE_H, col);
		} else if (a==0) {
			drawDigitSmall(b, x, y); x +=8;
			drawDigitSmall(c, x, y); x +=8;
			TFT_fillRect(x, y, SA_IMAGE_W, SA_IMAGE_H, col);
		} else {
			drawDigitSmall(a, x, y); x +=8;
			drawDigitSmall(b, x, y); x +=8;
			drawDigitSmall(c, x, y);
		}
	} else {
		if ((a==0) && (b==0)) {
			TFT_fillRect(x, y, SA_IMAGE_W, SA_IMAGE_H, col); x +=8;
			drawDigitSmall(c, x, y); x +=8;
			TFT_fillRect(x, y, SA_IMAGE_W, SA_IMAGE_H, col);
		} else if (a==0) {
			TFT_fillRect(x, y, 4, SA_IMAGE_H, col); x +=4;
			drawDigitSmall(b, x, y); x +=8;
			drawDigitSmall(c, x, y); x +=8;
			TFT_fillRect(x, y, 4, SA_IMAGE_H, col);
		} else {
			drawDigitSmall(a, x, y); x +=8;
			drawDigitSmall(b, x, y); x +=8;
			drawDigitSmall(c, x, y);
		}
	}
}
